import { Route, Routes } from "react-router-dom";
import Home from "../home/Home.component";

const Shop = () => {
  return <h1>Hello shop</h1>
} 





const App = () => {


  return (

    <Routes>
       <Route exact path="/" element={<Home/>}>
         <Route path='shop' element={<Shop/>}></Route>
       </Route>
      {/* <Route path="/home" element={<Home />} />  */}
    </Routes>
  );
};

export default App;
